import './App.css';
function Navigation ()
{
  return (
    <div>
      <nav>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
          <input type="name"></input>
          <button>Search</button>

        </ul>

      </nav>
    </div>
  );
}

function Body ()
{
  return (
    <div>
      <h1>Home</h1>
      <p>This is the home page</p>
    </div>
  );
}

export default Navigation;
